import './App.css';

export default function(){
  return (
    <React.Fragments>
      <div style = {{width:"50%",height:"100%"}}>
        <iframe src="https://giphy.com/embed/ocuQpTqeFlDOP4fFJI" width="90%" height="300%" style={{position:"absolute"}} frameBorder="0" class="noHover" allowFullScreen>
        </iframe>
      </div>
      <span style={{color:"#6a197d"}}>GPS Dashboard</span>
    </React.Fragments>
  );
}
